import React,{ useState } from 'react';
import logo from '../public/logo1.png';
import ReactDOM from "react-dom";
import { Link,
         BrowserRouter as Router
        } from 'react-router-dom';

const Header = () => {
  const temp = {
    float: "right"
  }

  return(
      <Router>
        <nav class="navbar navbar-expand-lg bg-transperent navbar-transperent sticky-top">
          <a  class="navbar-brand text-light" href="#">
            <img src={logo} width="35" height="35" class="d-inline-block align-top" alt="" />
            MyPortFolio
          </a>
          <ul class="navbar-nav justify-content-end ml-auto">
            <li class="nav-item">
              <Link to='/'>
              <a class="nav-link  text-light">Home</a>
              </Link>
            </li>
            <li class="nav-item ml-3">
              <Link to='/projects'>
              <a class="nav-link text-light">Projects</a>
              </Link>
            </li>
            <Link to='/resume'>
            <li class="nav-item ml-3 mr-3">
              <a class="nav-link text-light">Resume </a>
            </li>
            </Link>
          </ul>
        </nav>
      </Router>
  );

}

export default Header;
